import React, {Component} from 'react';

import {BrowserRouter, Route, Switch} from 'react-router-dom';

import MainPage from "./MainPage/MainPage";

import './assets/css/MainPage.css'

import SignInPage from './SignIn/SignInPage';

import "./assets/css/SignInPage.css";

import './assets/css/App.css';

import PersonalInfo from './PersonalInfo/PersonalInfo';

import FindPasswordPage from "./FindPassword/FindPasswordPage";

import RegisteredPage from "./Part1File/RegisteredPage";

import RegisterPage from "./Part1File/RegisterPage";

var storage = window.localStorage;

class App extends Component{
  render() {
    storage.setItem("TopBarKey","扶뒬못");
    return(
        <div className='App'>
          <BrowserRouter>
            <Switch>
              <Route exact path = "/" component = {MainPage}/>
              <Route path="/SignInPage" component={SignInPage}/>
              <Route path="/FindPasswordPage" component={FindPasswordPage}/>
              <Route path="/PersonalInfo" component={PersonalInfo}/>
              <Route path="/RegisteredPage" component={RegisteredPage}/>
              <Route path="/RegisterPage" component={RegisterPage}/>
            </Switch>
          </BrowserRouter>
        </div>
    )
  }
}
export default App;
